import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
  <Switch>
          <Route path="/create">
            <Create />
          </Route>
          <Route path="/join">
            <Join />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
  </Router>
  );
}

function Home() {
  return <div>
            <h2>Home</h2>
              <div className="button-list-landing-page">
                <button>Create game</button>
                <button>Join game</button>
                <Link to="/create" activeClassName="main-btn">Create Game</Link>
                <Link to="/join">Join Game</Link>
              </div>
        </div>;
}

function Create() {
  return <h2>Create a game</h2>;
}

function Join() {
  return <h2>Join a game</h2>;
}

export default App;
